import React from 'react';

const RoleList = (props) => {
    const rl = [];

    if (props.clashteam.players != undefined) {
        for (const [index, value] of props.clashteam.players.entries()) {
            rl.push(<h1 key={index}>{value}</h1>)
        }
    }

    console.log(rl);

    if (rl.length > 0) {
        return (
            <div>
                {
                    { rl }
                }
            </div>
        );
    }
    else return (<div></div>);
}

export default RoleList;
